import java.util.regex.*;

/**
 * Given a string s containing an out-of-order English representation of digits 0-9, return the digits in ascending order.
 * <p>
 * Example 1:
 * <p>
 * Input: s = "owoztneoer"
 * Output: "012"
 * Example 2:
 * <p>
 * Input: s = "fviefuro"
 * Output: "45"
 * <p>
 * Constraints:
 * <p>
 * 1 <= s.length <= 105
 * s[i] is one of the characters ["e","g","f","i","h","o","n","s","r","u","t","w","v","x","z"].
 * s is guaranteed to be valid.
 * <p>
 * zero; one; two; tree; four; five; six; seven; eight; nine
 */

public class ReconstructOriginalDigitsFromEnglish {
    public static void main(String[] args) {
        String s = "owoztneoer";
        System.out.println(originalDigits(s)); // 012
        s = "fviefuro";
        System.out.println(originalDigits(s)); // 45
        s = "fivetwozeroeightnineone";
        System.out.println(originalDigits(s)); // 012589
        s = "zerozero";
        System.out.println(originalDigits(s)); // 00
//        s = "";
//        System.out.println(originalDigits(s));
    }

    public static String originalDigits(String s) {
        while (!isNumeric(s)) {

            if (s.contains("n") && s.contains("i") && s.contains("n") && s.contains("e")) {
                s = "9" + s;
                s = s.replaceFirst("n", "");
                s = s.replaceFirst("i", "");
                s = s.replaceFirst("n", "");
                s = s.replaceFirst("e", "");
            }

            if (s.contains("e") && s.contains("i") && s.contains("g") && s.contains("h") && s.contains("t")) {
                s = "8" + s;
                s = s.replaceFirst("e", "");
                s = s.replaceFirst("i", "");
                s = s.replaceFirst("g", "");
                s = s.replaceFirst("h", "");
                s = s.replaceFirst("t", "");
            }

            if (s.contains("s") && s.contains("e") && s.contains("v") && s.contains("e") && s.contains("n")) {
                s = "7" + s;
                s = s.replaceFirst("s", "");
                s = s.replaceFirst("e", "");
                s = s.replaceFirst("v", "");
                s = s.replaceFirst("e", "");
                s = s.replaceFirst("n", "");
            }

            if (s.contains("s") && s.contains("i") && s.contains("x")) {
                s = "6" + s;
                s = s.replaceFirst("s", "");
                s = s.replaceFirst("i", "");
                s = s.replaceFirst("x", "");
            }

            if (s.contains("f") && s.contains("i") && s.contains("v") && s.contains("e")) {
                s = "5" + s;
                s = s.replaceFirst("f", "");
                s = s.replaceFirst("i", "");
                s = s.replaceFirst("v", "");
                s = s.replaceFirst("e", "");
            }

            if (s.contains("f") && s.contains("o") && s.contains("u") && s.contains("r")) {
                s = "4" + s;
                s = s.replaceFirst("f", "");
                s = s.replaceFirst("o", "");
                s = s.replaceFirst("u", "");
                s = s.replaceFirst("r", "");
            }

            if (s.contains("t") && s.contains("h") && s.contains("r") && s.contains("e") && s.contains("e")) {
                s = "3" + s;
                s = s.replaceFirst("t", "");
                s = s.replaceFirst("h", "");
                s = s.replaceFirst("r", "");
                s = s.replaceFirst("e", "");
                s = s.replaceFirst("e", "");
            }

            if (s.contains("t") && s.contains("w") && s.contains("o")) {
                s = "2" + s;
                s = s.replaceFirst("t", "");
                s = s.replaceFirst("w", "");
                s = s.replaceFirst("o", "");
            }

            if (s.contains("o") && s.contains("n") && s.contains("e")) {
                s = "1" + s;
                s = s.replaceFirst("o", "");
                s = s.replaceFirst("n", "");
                s = s.replaceFirst("e", "");
            }

            if (s.contains("z") && s.contains("e") && s.contains("r") && s.contains("o")) {
                s = "0" + s;
                s = s.replaceFirst("z", "");
                s = s.replaceFirst("e", "");
                s = s.replaceFirst("r", "");
                s = s.replaceFirst("o", "");
            }
        }
//        }
        return s;
    }

    public static boolean isNumeric(String s) {

        if (s == null || s.equals("")) {
            return false;
        }

        try {
            int intValue = Integer.parseInt(s);
            return true;
        } catch (NumberFormatException ignored) {
        }
        return false;
    }
}

